import ParentHook from "../components/ParentHook";
import './Style.css';
import { Link } from "react-router-dom";


export default function Timer(){
    const[timer, setTimer] = useState(0);

    
    const tick = () =>{
        setTimer(timer+1)
    }
    
    useEffect(()=>{
        setInterval(tick, 10)
    },[]


     )


    return(
    <React.Fragment>
      
    <div className="styleTimer" >
    <p>Timer</p>
    
        <h1>{timer}</h1>
      
        </div>
        </React.Fragment>
    )
}
